import React from 'react'
import styled from 'styled-components'

function list() {
    return (
        <Listt>
            <ul>
                <li>1</li>
                <li>2</li>
                <li>3</li>
            </ul>
        </Listt>
    )
}

export default list


const Listt = styled.div`
ul{
    position: relative;
    bottom: 0;
    left: 25%;
    display: flex;
    list-style: none;
    font-weight: 100;
    font-size: 14px;
    font-family: cursive;
    justify-content: space-between;
    width: 5%;

}
`
